import React, { useState } from 'react';
// import './App.css';
// import Logo from './logo.svg'
import './log.css'
function Login() {
  const [loginStatus2, setloginStatus2] = useState("");
  // const navigate = useNavigate();
  const [values, setValues] = useState({
    email: "",
    password: "",
  });
  const [errors, setErrors] = useState({});

  
  const handleInput = (event) => {
    setValues((prev) => ({ ...prev, [event.target.name]: event.target.value }));
  };
  const [isLogIn, setIsLogIn] = useState(true);
  const [isActive, setIsActive] = useState(false);


  const handleChangeClick = () => {
    setIsLogIn(!isLogIn);
    
  };


  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleUsernameChange = (event) => {
    setUsername(event.target.value);
  };

  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Add your login logic here
    console.log(`Username: ${username}, Password: ${password}`);
  };

  return (
    <div className="Login">
      {/* <div className="center2">
<img className='' src={Logo} alt="logo"></img>
</div> */}
<div className='parent body'>


<div  className={`container ${isLogIn ? 'log-in' : ''} ${isActive ? 'active' : ''}  `}>

  <div className="box "></div>
  <div  className="container-forms">
    <div className="container-info">
      <div className="info-item">
        <div className="table">
          <div className="table-cell">
            <p>
              Have an account?
            </p>
            <div className="btn " type="submit" onClick={handleChangeClick}>
              Log in
            </div>
          </div>
        </div>
      </div>
      <div className="info-item">
        <div className="table">
          <div className="table-cell">
            <p>
              Don't have an account? 
            </p>
            <div className="btn" onClick={handleChangeClick}>
              Sign up
            </div>
          </div>
        </div>
      </div>
    </div>
    <div className="container-form ">
      <div className="form-item log-in">
        <div className="table">
          <div className="table-cell">
          <input name="name"  placeholder="Name" type="text" />

            <input name="emaill" onChange={handleInput} placeholder="Email" type="text" />
            {errors.email && <span className='text-danger'>{errors.email}</span>}
            <input name="passwordl" onChange={handleInput} placeholder="Password" type="Password" />
            {errors.password && <span className='text-danger'>{errors.password}</span>}

            <button className="btn child2" type="submit" onClick={handleSubmit}>
              Log in
            </button>
          </div>
        </div>
      </div>
      <div className="form-item sign-up ">
        <div className="table ">
          <div className="table-cell ">
          <input type='text' onChange={handleInput} className='form-control rounded-0' id="name" name="name" placeholder='Enter Name' />
              {errors.name && <span className='text-danger'>{errors.name}</span>}
              <input type='email' onChange={handleInput} className='form-control rounded-0' id="email" name="email" placeholder='Enter Email' />
              {errors.email && <span className='text-danger'>{errors.email}</span>}
              <input type='text' onChange={handleInput} className='form-control rounded-0' id="uname" name="uname" placeholder='Enter Username' />
              {errors.name && <span className='text-danger'>{errors.name}</span>}
              <input type='password' onChange={handleInput} className='form-control rounded-0' id="password" name="password" placeholder='Enter Password' />
              {errors.password && <span className='text-danger'>{errors.password}</span>}
            <button className="btn center " onClick={handleSubmit}>
              Sign up
            </button>
          </div>
        </div>
      </div>
    </div>
  </div>
</div>

</div>
</div>
  
  );
}

export default Login;
